import React from "react";
import data from './data/info';

const Benefits = () => {
	return(
	<div className="benefits row">
      <div>
        <span className="row">
          <h3>Learn with others</h3>
          <img src="./images/partner.png"/>
        </span>
        <p>
          You get to learn at your convenience with other students in your cohorts, lets say you missed a className; you will get the pre-recorded video of the className you missed as meeting occur via a screen sharing platform like zoom and communication is done via an online messaging platform like whatsapp.
          You are also attached with accountablity partners in your cohort to ensure you reach your individual and group goals.
        </p>
      </div>  
    </div>
		)
}
export default Benefits;
